  return (
    <section className="w-60 py-5">
      <div className="container row">
        <div className="col-lg-7 col-md-7 col-sm-12">
          <h1 className="py-4">Ayaan Malik</h1>
          <p>Wassim is an engineer and thought leader working on helping developers build a faster Web. Wassim loves teaching about the Web Platform, Cloud technologies and JavaScript</p>
        </div>
      </div>
    </section>
  );
}

export default Hero;
